		C20047E32E8383AF005702BE /* Strip Bitcode From Embedded Frameworks */ = {
			isa = PBXShellScriptBuildPhase;
			buildActionMask = 2147483647;
			files = (
			);
			inputFileListPaths = (
			);
			inputPaths = (
			);
			name = "Strip Bitcode From Embedded Frameworks";
			outputFileListPaths = (
			);
			outputPaths = (
			);
			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "# ===== Guard switches (put at very top) =====\n# A) Only run for Release archives (skip for Debug/local installs)\n[ \"$CONFIGURATION\" = \"Release\" ] || { echo \"Strip bitcode: skipped (not Release)\"; exit 0; }\n\n# B) Scheme toggle ‚Äî in Edit Scheme ‚Üí Run/Archive ‚Üí Arguments ‚Üí Environment Variables\n#    add DISABLE_BUILD_SCRIPTS=1 to disable on demand\n[ \"${DISABLE_BUILD_SCRIPTS:-0}\" = \"1\" ] && { echo \"Strip bitcode: disabled via scheme\"; exit 0; }\n\n# C) Project/user-defined toggle ‚Äî add STRIP_BITCODE_ENABLED=NO in Build Settings to turn off\n[ \"${STRIP_BITCODE_ENABLED:-YES}\" = \"YES\" ] || { echo \"Strip bitcode: disabled by build setting\"; exit 0; }\n# ===========================================\n\nset -euo pipefail\n\nAPP_FRAMEWORKS_DIR=\"${TARGET_BUILD_DIR}/${WRAPPER_NAME}/Frameworks\"\n\nif [ -d \"$APP_FRAMEWORKS_DIR\" ]; then\n  echo \"Stripping bitcode from embedded frameworks in: $APP_FRAMEWORKS_DIR\"\n  find \"$APP_FRAMEWORKS_DIR\" -type d -name \"*.framework\" | while read -r FW; do\n    BIN=\"$FW/$(basename \"$FW\" .framework)\"\n    if [ -f \"$BIN\" ]; then\n      # Only strip if a bitcode section exists\n      if xcrun otool -l \"$BIN\" | grep -q __LLVM; then\n        echo \" - $BIN (has bitcode) ‚Üí stripping\"\n        xcrun bitcode_strip -r \"$BIN\" -o \"$BIN\"\n\n        # Re-sign after modifying the binary, or installs will fail\n        if [ \"${CODE_SIGNING_ALLOWED}\" = \"YES\" ]; then\n          echo \"   re-signing $FW\"\n          codesign --force --sign \"${EXPANDED_CODE_SIGN_IDENTITY}\" --preserve-metadata=identifier,entitlements \"$FW\"\n        fi\n      else\n        echo \" - $BIN (no bitcode) ‚Üí skipping\"\n      fi\n    fi\n  done\nfi\n";
		};
